import React from "react";
import "./UserUser.css";

function UserUser(props) {
  const { userUser, className } = props;

  return (
    <div className={`user-user ${className || ""}`}>
      <img className="user-user-1" src={userUser} />
    </div>
  );
}

export default UserUser;
